// Parse the response body as JSON
const responseBody = JSON.parse(insomnia.response.body);
console.log("insomnia" + insomnia);
console.log(responseBody);
console.log(responseBody.List.includes("SN048"));

// Check if the "List" array exists
if (!responseBody.List || !Array.isArray(responseBody.List)) {
  throw new Error('Expected "List" to be an array, but it is missing or not an array');
}

// Check if "SN048" is present in the "List" array
if (!responseBody.List.includes("SN048")) {
  throw new Error('Expected "SN048" to be present in the "List", but it was not found');
}

// Optional: Log success for debugging purposes
console.log('Test passed: "SN048" is present in the "List"');

